import React from "react";
import styles from "../styles/ProjectLists.module.css";
import ProjectBox from "./ProjectBox";

export default function ProjectLists() {
  return (
    <div
      style={{
        marginTop: "100px",
        display: "flex",
        gap: "30px",
        justifyContent: "center",
      }}
    >
      <ProjectBox />
      <ProjectBox />
      <ProjectBox />
      <ProjectBox />
      <ProjectBox />
      <ProjectBox />
      <ProjectBox />
      <ProjectBox />
      <ProjectBox />
    </div>
  );
}
